        oldy = this.curr_xy[i*2+1];
        
        newx = m[0]*x + m[1]*y + m[2];
        newy = m[3]*x + m[4]*y + m[5];
        
        displacement = Math.sqrt((x-newx)*(x-newx)+(y-newy)*(y-newy));
        //if (displacement > max_displacement) { 
        this.curr_xy[i*2] = newx;
        this.curr_xy[i*2+1] = newy;
