        //this.curr_xy[i*2+1] = (this.curr_xy[i*2+1]+y)/2;
        
        //}
        // if (point_status[i] == 1) {
        //   this.curr_xy[i*2] = oldx;
        //   this.curr_xy[i*2+1] = oldy;
        //   continue;
        // }
        
        // continue;
        
        // var diff1 = (this.curr_xy[i*2]-oldx);
        // diff1 = diff1*diff1;
        
        // var diff2 = (this.curr_xy[i*2+1]-oldy);
        // diff2 = diff2*diff2;
        
        // if (diff1 > 9)
